import React from 'react'

const CartList = ({cartList}) => {
  return (
    <div>
        {
            cartList.map((items,index)=>{
                return(
                    <div key={index}>
                      <img src={items} alt="" />
                    </div>
                )
            })
        }
    </div>
  )
}

export default CartList
